import React,{ useState} from 'react';
import { 
    Box, 
    Typography 
} from '@mui/system';
import { DialogTitle, List, ListItem, ListItemText } from '@mui/material';


const Gopay = () =>{
    return(
    <Box
    sx={{
        display:'flex',
        flexDirection:'row',
        alignItems:'center',
        gap:'16px',
    }}>
        <Box
        component='img'
        src='./Soup/Gopay.svg'
        height='35px'
        />
        <Typography fontFamily='Poppins' fontWeight={500} fontSize='18px'>
            Gopay
        </Typography>

    </Box>
    )
};

const payment = [<Gopay/>,'OVO','DANA','Mandiri','BCA','BNI'];

const PaymentMethod = () => {
    const [open, setOpen] = useState(false);
    const handleListItemClick = () => {
        setOpen(false);
      };
  return (
    <div>
      <DialogTitle fontFamily='Poppins'>Select Payment Method</DialogTitle>
        <List sx={{ pt: 0 }}>
        {/* <ListItem>
            <Gopay/>
        </ListItem> */}
        {payment.map((payment) => (
        <ListItem button onClick={() => handleListItemClick(payment)} key={payment}>
            {/* <ListItemAvatar>
            <Avatar sx={{ bgcolor: blue[100], color: blue[600] }}>
                <PersonIcon />
            </Avatar>
            </ListItemAvatar> */}
            <ListItemText primary={payment} />
        </ListItem>
        ))}

        </List>
    </div>
  )
};

export default PaymentMethod;
